import React from "react";
import FooterItem from "./FooterItem";

const Footer = (props) => {
  const items = props.footer.map((item) => item.col_values);
  console.log(items);
  return (
    <div className="container">
      <div className="row">
        {props.footer.map((item) => {
          return;
          <div className="col-12 col-lg">
            <ul>{item.col_values}</ul>
          </div>;
        })}
        {/* <FooterItem items={items} /> */}
      </div>
    </div>
  );
};

export default Footer;
